    cs: '<uu5string/>Jednotka (<UU5.Bricks.Code content="uuUnit"/>) reprezentuje Organizační jednotku v organizační struktuře teritoria. Slouží pro umístění artefaktů v rámci teritoria, ve kterém Jednotky vytváří stromovou strukturu. Jednotka má také důležitou roli pro stanovení oprávnění plynoucího z organizační struktury. V rámci Jednotek mohou být ještě artefakty zařazovány do Složek, které v každé jednotlivé Jednotce mohou tvořit další podřazenou stromovou strukturu.' + "<br/><br/>Více informací naleznete v knize <UU5.Bricks.Link content='uuBusinessTerritory - Dokumentace' href='https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-aaba4b1d6f0746a8abfab638fb98971f/book/page?code=BM_Unit_01' target='_blank'/>.",
    "en-gb": '<uu5string/>Unit (<UU5.Bricks.Code content="uuUnit"/>) represents Organizational unit in organizational structure of territory. It serves for storing artifacts within the territory where Units form the tree structure. Unit has also important purpose in setting of permissions that flow from organization structure. The artifacts within the Unit can be placed in the Folders that form additional tree structure within the Unit.' + "<br/><br/>For more information visit <UU5.Bricks.Link content='uuBusinessTerritory - Documentation' href='https://uuos9.plus4u.net/uu-bookkitg01-main/78462435-aaba4b1d6f0746a8abfab638fb98971f/book/page?code=BM_Unit_01' target='_blank'/>."
