    cs: "V Jednotce, respektive její hlavní složce, jsou umístěny artefakty - např. jednotky, role a nebo artefakty zastupující objekt aplikace v organizační struktuře teritoria. To je například Kniha z aplikace uuBookKit nebo Diskuze z aplikace uuForum. Po volbě artefaktu je uživatel přesměrován na jeho detail (artefakty aplikace uuBusinessTerritory) nebo dojde k otevření výchozí funkčnosti daného artefaktu do nového okna (artefakty ostatních aplikací).",
    "en-gb": "The Unit (in its main folder) contains artifacts - for example units, roles or artifacts that represents application object in organizational territory structure. For examples Book from uuBookKit application or Discussion from uuForum application. After clicking on the artifact the user is redirected to the artifact detail (artifacts of uuBusinessTerritory application) or the default function of artifact is opened into the modal window (artifacts of all rest applications)."
