    "en-gb": "<uu5string/>The Unit Group <UU5.Bricks.Code>uuUnitGroup</UU5.Bricks.Code> grants cast roles and groups to access the Unit. Each Unit has 32 positions available for Unit Groups, position 0 - <i>Authorities</i> is always cast. Groups at these positions 1 - <i>Managers</i>, 2 - <i>Executives</i>, 28 - <i>Superiors</i>, 30 - <i>Auditors</i>, 31 - <i>Guests</i> are special groups and for these groups is defined special logic in the context of uuBusinessTerritory. Unit Groups in other positions can be used arbitrarily according to the needs of the Unit."
