    "en-gb": "Unit access checker is used to verify whether the entered role or group has access to the Unit through the Unit groups. It is possible to enter Access role, Role or Group. Component will render all Unit groups and information if entered role or group has cast to them. Artifact Authorities can add or remove cast."
